import { Component } from 'react';

import logo from './logo.svg';
import './App.css';


class App extends Component{
  constructor(){
    super();

    this.state = {
     monsters:[
      {name:'Gurmeet',
      id:'124dfr5'
    },
      {name:'Victor',
      id:'12sadffr5'},
      {name:'Simon',
      id:'124knjng5'}

    ]

  }
}


  render() {
      return (
        <div className="App">
          {
            this.state.monsters.map((monster)=>{
            return <div key={monster.id}><h1 >{monster.name}</h1></div>;
            })
          }
        </div>
      );
    }
}



export default App;
